    const toDoList = props.allTasks;
    let arr = [1,2,3,4,5];
    return (
        <div>
            {
                arr.map( e => <TaskItem title={e.tasktitle} daysLeft={e.taskDaysLeft} /> )
            }
        </div>
    ); 
}

export default TaskList;
